import React from 'react';
import {Routes,Route} from "react-router-dom";
import {ROUTING} from "./contsRoute";
import Container from "../componets/layout/container/container";
import Main from "../pages/main";

const AppRoute = () => {
    return (
        <Routes>
            {ROUTING.map(link=>(
                <Route key={link.path} path={link.path} element={
                    <Container>
                        {link.component}
                    </Container>
                }/>
            ))}
            <Route path="*" element={
                <Container>
                    <Main/>
                </Container>
            }/>
        </Routes>
    );
};

export default AppRoute;
